// import React, { useState, useEffect } from "react";



function Player(props){
    let KDA;
    props.props.deaths === 0 ? KDA = ((props.props.kills + props.props.assists)/1).toFixed(2) : KDA = (props.props.kills + props.props.assists/props.props.deaths).toFixed(2);
    function handleClick(event){
        event.preventDefault();
        props.handleClick(props.props.summonerName);
    }
// const [playerInfo, setPlayerInfo] = useState({});
// useEffect(() => {setPlayerInfo(props)}, 
//     [props]);
// console.log(playerInfo);
return (<div className = "Player">
            <p>Player {props.playerNumber + 1}: <strong>{props.props.summonerName}</strong> </p>
            <p>K/D/A:  <strong>{props.props.kills}/{props.props.deaths}/{props.props.assists}</strong>  (<strong>{KDA}</strong> KDA)</p>
            <h1>Champion: {props.props.championName}</h1> <img src = {`http://ddragon.leagueoflegends.com/cdn/12.9.1/img/champion/${props.props.championName}.png`} alt = "Champion-Splash-Img"></img>
            <h3>Lane: {props.props.lane}</h3>
            <button onClick = {handleClick}> Look Up Player: {props.props.summonerName} </button>
        </div>);
}

export default Player;
